import { useEffect, useState } from "react";
import "./DetailsChairs.css";
import ChairModel from "../../../Models/chair-model";
import moviesService from "../../../Services/movies-service";
import { useParams } from "react-router-dom";
import notify from "../../../Utils/Notify";
import Chairs from "../Chairs/Chairs";

function DetailsChairs(): JSX.Element {

    const [chair, setChair] = useState<ChairModel[]>([]);
    const params = useParams();

    useEffect(() => {
        moviesService.getAllChairs()
            .then(chair => setChair(chair))
            .catch(err => notify.error(err))
    }, [])




    return (
        <div className="DetailsChairs">

            {chair.map((item) => <Chairs key={item.chairId} chair={item} />)}

        </div>
    );
}

export default DetailsChairs;
